import React from "react";
import {Link} from 'react-router-dom';

function Game(props) {
  console.log(props.name);
  return (
    <div className="gameCard">
      <Link to={`/Games/${props.name}`}>
        <img className="gameCard" src={`./games/${props.src}`} alt={props.name}/>
      </Link>
    </div>
  );
}

export default Game;
